// src/components/LoginModal.jsx
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Logo2 from "../../../assets/Logo2.png";
import { motion } from 'framer-motion';
import axios from 'axios';
import { jwtDecode } from 'jwt-decode';

const LoginModal = ({ isOpen, onClose }) => {
  const [isLogin, setIsLogin] = useState(true);
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('http://localhost:5000/login', {
        email,
        password
      });

      const { token, role } = response.data;

      localStorage.setItem('token', token);
      localStorage.setItem('role', role);

      const decodedToken = jwtDecode(token);
      if (decodedToken.role === 'admin') {
        navigate('/DashboardAdmin');
      } else if (decodedToken.role === 'staff') {
        navigate('/dashboard');
      }

      onClose(); // Close the modal after successful login
    } catch (error) {
      if (error.response && error.response.status === 400) {
        setError('Password salah!');
      } else if (error.response && error.response.status === 404) {
        setError('User tidak ditemukan!');
      } else {
        setError('Terjadi kesalahan pada server.');
      }
    }
  };

  return (
    isOpen && (
      <div className="fixed inset-0 flex justify-center items-center bg-black bg-opacity-50 z-50">
        <div className="bg-white dark:bg-gray-100 rounded-lg shadow-lg flex flex-col md:flex-row w-[90%] max-w-[500px] overflow-hidden">
          <motion.div
            initial={{ opacity: 0, x: -200 }}
            animate={{ opacity: 1, x: 0 }}
            exit={{ opacity: 0, x: -200 }}
            className="flex-1 p-6 md:p-10 flex flex-col justify-center"
          >
            <img src={Logo2} alt="Logo" className="h-20 w-20 md:h-28 md:w-32 mx-auto" />
            <h2 className="text-2xl md:text-3xl font-bold mb-4 md:mb-6 mx-auto">
              {isLogin ? 'Login' : 'Reset Password'}
            </h2>

            <form className="space-y-4" onSubmit={handleLogin}>
              {isLogin ? (
                <>
                  <input
                    type="email"
                    placeholder="Enter your Email"
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                    className="w-full p-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-purple-500"
                  />
                  <input
                    type="password"
                    placeholder="Password"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    className="w-full p-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-purple-500"
                  />
                  {error && <p className="text-red-500">{error}</p>}
                  <button
                    type="submit"
                    className="w-full py-3 bg-purple-600 text-white rounded-lg hover:bg-purple-700 transition duration-300"
                  >
                    Sign In
                  </button>
                </>
              ) : (
                <>
                  <input
                    type="email"
                    placeholder="Enter your Email to reset password"
                    className="w-full p-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-purple-500"
                  />
                  <button
                    type="submit"
                    className="w-full py-3 bg-purple-600 text-white rounded-lg hover:bg-purple-700 transition duration-300"
                  >
                    Reset Password
                  </button>
                </>
              )}
            </form>
          </motion.div>
          <motion.div
            initial={{ opacity: 0, x: 200 }}
            animate={{ opacity: 1, x: 0 }}
            exit={{ opacity: 0, x: 200 }}
            className="flex-1 bg-gradient-to-r from-purple-600 to-purple-400 text-white p-6 md:p-10 flex flex-col justify-center items-center"
          >
            <h2 className="text-2xl md:text-3xl font-bold mb-4">
              {isLogin ? 'Forget Password?' : 'Back to Login'}
            </h2>
            <p className="mb-4 text-center text-sm md:text-base">
              {isLogin
                ? 'Register with your personal details to use all of the site\'s features'
                : 'Go back to login to access your account'}
            </p>
            <button
              onClick={() => setIsLogin(!isLogin)}
              className="py-2 px-6 md:py-3 md:px-8 bg-white text-purple-600 rounded-lg hover:bg-gray-100 transition duration-300"
            >
              {isLogin ? 'Reset' : 'Login'}
            </button>
          </motion.div>
          <button className="absolute top-2 right-2 text-gray-500" onClick={onClose}>âœ–</button>
        </div>
      </div>
    )
  );
};

export default LoginModal;
